;; gorilla-repl.fileformat = 1

;; **
;;; # gg4clj demo
;;; 
;;; This worksheets demonstrates the usage of gg4clj, a wrapper for R's ggplot2 in Clojure.
;; **

;; @@
(ns gg4clj.demo
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.html :as html]
            [clojure.string :as string]
            [gg4clj.core :as gg4clj]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def xs (range 0 10 1))
(def ys (map #(Math/sin %) xs))
(def dat {:x xs :y ys})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gg4clj.demo/dat</span>","value":"#'gg4clj.demo/dat"}
;; <=

;; @@
(def plot
  [[:<- :d (gg4clj/data-frame dat)]
   [:+
    [:qplot :x :y {:data :d :geom [:c "point" "line"] :span 1}]
    [:theme_bw]]])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gg4clj.demo/plot</span>","value":"#'gg4clj.demo/plot"}
;; <=

;; @@
(gg4clj/view plot)
